            <div class='tn-atom' field='tn_text_1663892177281'>We believe that all of the products we plan to deliver
              will be useful to people on any chain, not just sol. This is why when the main product line you see in the
              DELPHI section is finished and released on sol, we will be focusing to upgrade delphi to be a cross chain
              platform. The same utilities you see will be available with an ETH wallet. And not only ETH. Pls don’t be
              worried about dilution. Yes SOL NFT holders won’t receive profits from the ETH version of the website.The
              only way to get access to ETH rev share will be to own an ETH oracle... BUT there will be no more mints!
              The only way to obtain an ETH oracle will be an airdrop. And the only way to get that airdrop will be to
              burn your SOL oracle. This way the collection size will never change, it will just go cross chain. Now if
              you don’t understand how this benefits sol nft holders we will elaborate. People will burn SOL oracles to
              get airdrops on other chains. Thus the profits made from the sol version of delphi will be distributed
              between a smaller number of people, thus be higher. Another great thing of going cross chain is we
              increase our audience and potential pool of investors. Also our community becomes much more diverse, so
              many networking and earning possibilities become open to us. Anyway this isn’t something that will happen
              right away, but as already mentioned in the vision channel, oracles is for people with a long-term
              mindset.</div>
